import React, {Component} from 'react';
import User from './User'

class Users extends Component{
    state = {
        users :[
            {
                name: 'A'
            },
            {
                name: 'B'
            }
        ]
    }
    render(){
        return(
           <div>
               <User>{this.state.users[0].name}</User>
           </div>
        )
    }
}
export default Users
